examples:
Using an array
```ts
const fields: APIEmbedField[] = ...;
const embed = new EmbedBuilder()
	.addFields(fields);
```

Using rest parameters (variadic)
```ts
const embed = new EmbedBuilder()
	.addFields(
		{ name: 'Field 1', value: 'Value 1' },
		{ name: 'Field 2', value: 'Value 2' },
	);
```
